import React from 'react'
import { Link } from "react-router-dom";

function HomePage() {
    return (
        <div>
            Home Page
            <Link to="/post">Go Post Page</Link>
            <Link to="/get">Go Get Page</Link>
            <Link to="/put">Go Put Page</Link>
            <Link to="/delete">Go Delete Page</Link>
        </div>
    )
}

export default HomePage
